import './App.scss';

export default class Article extends React.Component {
    constructor(props) {
        super ( props )
    }

    render() {
        return (<div className={"horizontal-margin-10 grow-1 no-overflow"}>
            <div style={{background : `url={/assets/${this.props.image}`}}>

            </div>
            <h3>{this.props.title}</h3>
            <p>{this.props.text}</p>
        </div>)
    }
}
